import "./App.css";
import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import CustomerAddPage from "./pages/customerAddpage";

function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route exact path="/">
            <CustomerAddPage />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/dashboard">
            <Dashboard />
          </Route>
        </Switch>
      </Router>
    </>
  );
}

export default App;
